import Layout from '../components/Layout';
import SignupComponent from '../components/auth/SignupComponent';

const Signup = () => {
  return (
    <Layout>
      <h2>SignUp page</h2>

      <div className="row">
        <div className="col-md-8 offset-md-2">
          <SignupComponent />
        </div>
      </div>
    </Layout>
  );
};

export default Signup;
